	/// 数据类型ID
	/// </summary>
	public const int dataID=GameRequestType.PlayerExit;
	
	public PlayerExitRequest()
	{
		_dataID=GameRequestType.PlayerExit;
		setDontCache();
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "PlayerExitRequest";
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		base.toWriteBytesFull(stream);
		
		stream.startWriteObj();
		
		stream.endWriteObj();
	}
	
	protected override void copyData()
	{
		base.copyData();
	}
	
	/// <summary>
	/// 创建实例
	/// </summary>
	public static PlayerExitRequest create()
	{
		PlayerExitRequest re=(PlayerExitRequest)BytesControl.createRequest(dataID);
		return re;
	}
	
}
